var React = require('react');
var NavBar = require('NavBar');
var HomeMain = require('HomeMain');
var Footer = require('Footer');

var HomeApp = React.createClass({
	getInitialState() {
		return {
			mainImg: {
				placeholder: 'data:image/png;base64,',
				src: '/images/sierra-nevada-1920-min.png',
				alt :'Sierra Nevada mountain range.'
			}
		};
	},
	componentDidMount() {
		var app = document.body;
		if (app.hasAttribute('unresolved')) {
			app.removeAttribute('unresolved');
		}
	},
	render() {
		return (
			<div className="app" ref="app">
				<NavBar></NavBar>
				<HomeMain mainImg={this.state.mainImg}></HomeMain>
				<Footer></Footer>
			</div>
		);
	}
});

module.exports = HomeApp;